import React, { useState } from 'react';
import { fade, makeStyles } from '@material-ui/core/styles';
import SearchBar from 'material-ui-search-bar';
import { useHistory } from 'react-router-dom';
import './nav.css'
import CssBaseline from '@material-ui/core/CssBaseline';
import AppBar from '@material-ui/core/AppBar';
const useStyles = makeStyles((theme) => ({
	appBar: {
		borderBottom: `1px solid ${theme.palette.divider}`,
	},

}));
function Header() {
	const classes = useStyles();
	let history = useHistory();
	const [data, setData] = useState({ search: '' });

	const goSearch = (e) => {
		history.push({
			pathname: '/search/',
			search: '?search=' + data.search,
		});
		window.location.reload();
	};
	return (
		<React.Fragment>
			<CssBaseline />
			<AppBar
				position="static"
				color="default"
				elevation={0}
				className={classes.appBar}
			>
      <br/>
            <img src= 'https://media-exp1.licdn.com/dms/image/C510BAQFzmTl0wDAz9A/company-logo_200_200/0/1571652632244?e=2159024400&v=beta&t=eaKo0GEOitZiwddxEj0nHviaJUkB3IuudN4hfCTp4fE' className="center"/>

					<SearchBar 
						value={data.search}
						onChange={(newValue) => setData({ search: newValue })}
						onRequestSearch={() => goSearch(data.search)} style={{
                            margin: "0 auto",
                            maxWidth: 800,

                          }}

					/>
                    <br/>
<br/>
<br/>
<br/>



			</AppBar>
		</React.Fragment>
	);
}

export default Header;
